import React from 'react';
import logo from './logo.svg';
import './App.css';

class FeedUrlForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      feedUrl: null,
    };
  }

  handleSubmit(event) {
    alert('A name was submitted: ' + this.state.feedUrl);
    event.preventDefault();
  }

  render() {
    return (
      <div>
        <label>Enter feed url: </label>
        <form className="feed-url-form" onSubmit={this.handleSubmit()}>
          <input type="text" name="feed-url"></input>
          <input type="submit" value="Submit"/>
        </form>
      </div>
    );
  }
}


function App() {
  return (
    <FeedUrlForm />

  );
}

export default App;
